import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import {Navbar,Nav} from 'react-bootstrap';
import {Link} from "react-router-dom";


export default class NavbarCustom extends React.Component{




    render(){
       return  <Navbar bg="dark" expand="lg" variant="dark" className="p-3">
  <Navbar.Brand href="#home">DevBlog</Navbar.Brand>
  <Navbar.Toggle aria-controls="basic-navbar-nav" />
  <Navbar.Collapse id="basic-navbar-nav">
  <Nav className="mr-auto">
      <Link to="/" className="nav-link">Home</Link>
      <Link to="/about" className="nav-link">About</Link>
    </Nav>
    {localStorage.getItem('userData')?
     <Nav className="ml-auto">
     <Link to="/profile" className="nav-link">Profile</Link>
     <Link to="/profile" className="nav-link">Add Post</Link>
     </Nav>:
    <Nav className="ml-auto">
        <Link  to="/login" className="nav-link">Login</Link>

    </Nav> }
  </Navbar.Collapse>
</Navbar>
    }
}
